import React, { useState, useEffect } from "react";
import '../styles/About.css'
import { FaArrowRight, FaArrowLeft } from 'react-icons/fa';
import { useHistory } from 'react-router-dom'
import PlusImg from '../images/plus.svg'


const About = (props) => {

    const history = useHistory()

    return (
        <>
        <div className="about">
            <div className="about_header">
                <h1>Créons <span>ensemble</span> quelque chose. <br/>L'évènement qui vous <span>ressemble</span>.</h1>
            </div>
            <div className="about_content">
            </div>
            <div className="about_bottom">
                <h4>Vous ne trouvez pas de réponse à votre question ?</h4>
                <button onClick={() => history.push('/contact')} className="blue largeButton">Contactez-nous</button>
            </div>
        </div>
    </>
    )
}
export default About;
